import React from 'react';
import { useForm } from 'react-hook-form';

const HooksFrom = () => {
    const { register, handleSubmit, watch, errors } = useForm();
  const onSubmit = data => console.log(data);
    return (
        <div>
           <form onSubmit={handleSubmit(onSubmit)}>
           <input type="email" style={{ height: "50px", width: "100%", border:"none", borderRadius:"10px" }} name="email" placeholder="Enter Your email" ref={register({ required: true })} /> <br/> <br/>

           <input type="password" style={{ height: "50px", width: "100%", border:"none", borderRadius:"10px" }} name="pass" placeholder="Enter Your password" ref={register({ required: true })} /> <br/> <br/>
      
      <input style={{ height: "50px", width: "100%", border:"none", borderRadius:"10px" }} type="submit" />
    </form> 
        </div>
    );
};

export default HooksFrom;
